<script type="text/javascript">


var tab = document.getElementById("tab1");
var list = tab.getElementsByTagName("a");
var cf = {};
for(var i = 0, max = list.length; i < max; i++){
    var elem = list[i];
    var cl = +elem.getAttribute("tabindex");//.replace(/^.*?(\d+)$/, "$1"),
        key = elem.getAttribute("data-emoji");
	// 其中 1 - 636 之前的序号，是正确的
	if(cl <= 647){
		cf[cl < 10 ? "0" + cl : cl] = {key: key};
	}else if(cl >= 648 && cl <= 766){
		// 648 - 766 之间的 tabIndex 跟真正的图片序号，相差了2位: 图片 = tabIndex + 2;
		cf[cl] = {key: key};
	}else if(cl >= 767 && cl <= 780){
		// 这里的数据，是乱序
		cf[cl] = {key: key};
	}else if(cl >= 781 && cl <= 819){
		// 781 - 819, 图 和 索引的对应关系: 图片 = tabIndex + 5
		cf[cl] = {key: key};
	}else if(cl >= 820 && cl <= 821){
		// 这两个索引，是混乱的 820->773  821->772
		cf[cl] = {key: key};
	}else if(cl >= 822 && cl <= 842){
		// 图 = tabIndex + 3
		cf[cl] = {key: key};
	}
}
console.log(JSON.stringify(cf));
